void RunTest(const int nStartX, const int nStartY, const int nTargetX, const int nTargetY, const unsigned char* pMap,
		const int nMapWidth, const int nMapHeight, const int nOutBufferSize, const int expectedAnswer = 0)
{
	int pOutBuffer[nOutBufferSize];

	std::chrono::high_resolution_clock::time_point t1 = std::chrono::high_resolution_clock::now();

	int result = FindPath(nStartX, nStartY, nTargetX, nTargetY, pMap, nMapWidth, nMapHeight, pOutBuffer, nOutBufferSize);

	std::chrono::high_resolution_clock::time_point t2 = std::chrono::high_resolution_clock::now();
	auto duration = std::chrono::duration_cast<std::chrono::microseconds>( t2 - t1 ).count();
	std::cout<<"duration: "<<duration<<std::endl;

	//*********************************************

	int outputsize = ((result < nOutBufferSize) ? result : nOutBufferSize);

	/*for (int x = nMapWidth * (nMapHeight - 1); x >= 0; x -= nMapWidth)
	{
		for (int y = 0; y < nMapWidth; y++)
		{
			char o = (pMap[x + y] == 1) ? '.' : 'H';

			for (int i = 0; i < outputsize; i++)
			{
				if (pOutBuffer[i] == (x + y))
				{
					o = 'x';
					break;
				}
			}

			std::cout << o;
		}
		std::cout << std::endl;
	}*/

	std::cout << "pathlength = " << result << ", expected = "<< expectedAnswer << std::endl;
	/*std::cout << "path: ";

	for (int i = 0; i < outputsize; i++)
	{
		std::cout << pOutBuffer[i];

		if (i < outputsize)
		{
			std::cout << ", ";
		}
	}

	std::cout << std::endl;*/
	std::cout << "============================================" << std::endl;
}

